import React, { useState } from "react";
import data from "./Components/states.json"
import states from "./Components/states_obs.csv"
import "./App.css";
import Navbar from "./Components/Navbar";
import Section from "./Components/Section";
import dummyText from "./DummyText";
import GeoChart from "./Components/GeoChart";

console.log(data.features)
console.log(states.States)

function App() {

const [property, setProperty] = useState("CENSUSAREA");

console.log(data.objects);

    return (
      <div className="App">
        <Navbar />
        <Section
          title="Financial Literacy in The U.S."
          subtitle={"Click on the state to see financial literacy grade"}
          content={<GeoChart data={data} property={property}/>}
          subcontent={
            <div>
            <h2>World Map with d3-geo</h2>
            <h2>Select property to highlight</h2>
            <select
              value={property}
              onChange={event => setProperty(event.target.value)}
                >
            <option value="pop_est">Population</option>
            <option value="name_len">Name length</option>
            <option value="gdp_md_est">GDP</option>
            </select></div>}
          dark={false}
          id="section1"
        />
        <Section
          title="Section 2"
          subtitle={"Kathia Vargas Feliz"}
          dark={false}
          id="section2"
        />
        <Section
          title="Section 3"
          subtitle={dummyText}
          dark={true}
          id="section3"
        />
        <Section
          title="Section 4"
          subtitle={dummyText}
          dark={false}
          id="section4"
        />
        <Section
          title="Section 5"
          subtitle={dummyText}
          dark={true}
          id="section5"
        />
      </div>
    );
}



export default App;
